import React, { Component } from 'react'

class Sample extends Component {
    constructor(props) {
        super(props)

        this.state = {
                'name':'anuja' 
        }
    }

    render() {
        return (
            <div>
                {this.state.name}
            </div>
        )
    }
}

export default sample
